import React, { Component } from 'react';
import logo from './marvel-logo.png';
import Search from 'Search';
import './navbar.css';

class Navbar extends Component {
  render() {
    return (
        <nav className="barra">
            <img src={logo} className="logo"/>
            <Search/> 
        </nav>
    )
  }
}

export default Navbar;
